//component for RawEng 
import Navigation from '../components/Navigation'
const RawEng =()=>{

    return (
      <div>
          <Navigation/>
        <h2> Raw Engineering Home Page </h2>
        <p>
          Raw Engineering’s digital solutions and services have been trusted for
          more than 11 years by the world’s Most Innovative Startups, leading
          Fortune 500 companies, Sports & Events companies and Governments to
          provide a new generation of Real-Time, Engaging Experiences and
          Network DevOps..
        </p>
        <img src='/RawLogo.png' alt="Raw Engineering Logo" 
            height="100px"
            width="100px" />
      </div>
    );
}

export default RawEng;
